import PeopleIcon from '@material-ui/icons/People';





function Sidebar() {
    return (
        <div className="sidebar">
            <SidebarRow title="Pages"/>
            <SidebarRow title="Friends"/>
            <SidebarRow title="Pages"/>
            <SidebarRow />
